package phase1.practiceproblems;

public class DatatypeProgram {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int age=5;
		System.out.println("age value is: "+age);
		
		float percentage=78.934f;
		System.out.println("percentage value is: "+percentage);
		
		char gender='F';
		System.out.println("gender value is: "+gender);
		
		boolean pass=true;
		System.out.println("pass value is: "+pass);
		
		long distance=1986365272l;
		System.out.println("distance value is: "+distance);
		
		double radius=56.1936193713863d;
		System.out.println("radius value is: "+radius);
		
		byte b=34;
		System.out.println("b value is: "+b);

	}

}
